import React,{useState} from "react";


function Test(){
    const[testTitle, modifyTitle] = useState(['testtext1','testtext2','testtext3']);

    const[like,likeCount] =useState(0);

    function ChangeTitle(){
        var newArray = [...testTitle];
        newArray[0] = 'modified text';
        modifyTitle(newArray);
    }

    

    return(
        <div className="Test">
            <button onClick={ChangeTitle}>button</button>
            <h3>
                {testTitle[0]}
                &nbsp;
                <span onClick={()=>{likeCount(like +1)}}>‚ù§</span>
                &nbsp
                {like}
            </h3>
            <h3>
                {testTitle[1]}
            </h3>
            <h3>
                {testTitle[2]}
            </h3>
        </div>
    );
}

export default Test;
